import { Container, Row, Col, } from 'react-bootstrap';
import Stack from 'react-bootstrap/Stack';

import siteLogo from '../assets/sitelogoblue.png';

import "./Sidebar.css";

const Sidebar = () => {
  return (

      <Col className='sidebar my-4'>
        <Stack direction="vertical" className='' gap={3}>
          <a href="/" className='navbar-logo mx-auto'><img src={siteLogo} height="50px" alt="LOGO" /></a>

          <a href="" className="mx-auto">Dashboard</a>
          <a href="" className="mx-auto">Customers</a>
          <a href="" className="mx-auto">Analytics</a>

        </Stack>
      </Col>
  );
}

export default Sidebar;
